// this line should not be removed
var wBPMLanding = angular.module( "wBPMLanding",[]);


wBPMLanding.controller( "wBPMLandingController", ['$scope', '$sce', function($scope, $sce) {

    //NOTE: $sce is needed to allow us to put HTML within a GC (Angular requirement to limit spoofing data into an application)	

	//Fake data to populate the sparkline within the grid
	$scope.sparkLine = [
    { 
     "city": "High Importance Processes",
     "chartType": "line",
     "chartdata": "1:2,2:4,3:1,4:3,4:2,6:4,7:1,8:3,9:2,10:4,11:1,12:3"
    },
    { 
     "city": "Tasks executed on time",
    "chartType": "line",
     "chartdata": "1:4,2:3,3:2,4:1,5:4,6:3,7:2,8:1,9:4,10:3,11:2,12:1"
    },
    { 
     "city": "Tasks executed late",
    "chartType": "line",
    "chartdata": "1:3,2:1,3:4,4:2,5:3,6:1,7:4,8:2,9:3,10:1,11:4,12:2"
    },
    { 
     "city": "Active Tasks",
    "chartType": "line",
     "chartdata": "1:6,2:4,3:3,4:7,5:8,6:3,7:9,8:1,9:12,10:11,11:2,12:9"
    }];

    //Fake data for Graph
    $scope.areaChartData = {
        "series": [ "on Track", "At Risk", "Urgent"],
        "data": [
                {"x": "Q1", "y": [60, 31, 15] },
                {"x": "Q2", "y": [50, 50, 20] },
                {"x": "Q3", "y": [55, 24, 13] },
                {"x": "Q4", "y": [40, 21, 8]  }]
    };

    //Un-named function: called when the widget is created. Calls the DQ (2 of them) that calls the BPM engine and the internal Mongo DB
    var dq = new DataQuery( 'qGENGetInboxStats' );
    dq.execute().
    	done( function() {
    		$scope.$apply(function() {
    			$scope.results = dq.getData();

    		$scope.highTasks = $scope.results.High;
        	$scope.normalTasks = $scope.results.Normal;    		
         	$scope.lowTasks = $scope.results.Low;   		
        	$scope.bpmTasks = $scope.results.BPM;
        	$scope.emailTasks = $scope.results.Emails;    		
         	$scope.claimTasks = $scope.results.Claims;	

         	//Call BPM Stats
         	var dq2 = new DataQuery( 'qBPMGetStats' );
            dq2.execute().
            	done( function() {
            		$scope.$apply(function() {
            			$scope.results = dq2.getData().data.data;

                    //$scope.activeTasks = $scope.results.countActive;
        	        $scope.overdueTasks = $scope.results.countOverdue;    		
         	        $scope.onTrackTasks = $scope.results.countOnTrack;   		
        	        $scope.atRiskTasks = $scope.results.countAtRisk;
            		});
            	});
    		});
        });


    //---- Load sparkline into the grid
	$scope.gridDataLoaded = function(data, dt) {
	    //alert (data[$index]);
         $('span.bar').sparkline('html', { type: 'line' ,width:'180px'});
    };

	//call these functions to go to the various screens
    $scope.gotoInbox = function() { 
        loadURL('sInbox.html');
        return '';
    };

    $scope.gotoBPMTasks = function() { 
        loadURL('sBPMTasks.html');
        return '';
    };

    $scope.gotoBPMJobRequisition = function() { 
        loadURL('sBPMStartJobReq.html');
        return '';
    };

    $scope.gotoClaims = function() { 
        loadURL('sClaims.html');
        return '';
    };

}]);

